INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("春咲 ひより", 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 2, 0, 1, 1.4, 0, "お！\nあそこに困ってそうな人発見！", 1001);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("草野 優衣", 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 2, 0, 1, 1.4, 0, "大切な人を\n守れるようになりたい…って", 1002);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("士条 怜", 0, 0, "少しは磨かれると思いますよ。", 1, 0, "フェンシングを始めてみては？", 1, 2, 0, 1, 1.4, 0, "キミに必要な集中力と感性が", 1003);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("穂高 みそぎ", 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, "ねぇ、にいちゃん！", 1, 2, 0, 1, 1.5, 0, "今日はなにして遊ぶ？", 1004);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("風宮 あかり", 0, 0, "私といっしょに…\nいかない？", 1, 0, "風宮あかりです", 1, 2, 0, 1, 1.4, 0, "ねぇ…", 1006);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("出雲 宮子", 0, 0, "食べ物の恨みは怖いのー", 1, 0, "出雲宮子なのー", 1, 2, 0, 1, 1.5, 0, "プリンたべたいのー", 1007);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("虹村 雪", 0, 0, "いいよ。\n見られることは運命さ…", 1, 0, "ボクは虹村雪。", 1, 2, 0, 1, 1.4, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("柊杏奈", 0, 0, "人呼んで「疾風の冥姫」!!", 1, 0, "フッ…聞いて後悔するがいい！", 1, 2, 0, 1, 1.4, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("姫宮 真歩", 0, 0, "ほんまおおきにやわ～♪", 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 2, 0, 1, 1.5, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("衣之咲 璃乃", 0, 0, "ここで会ったが\n100年目～！", 1, 0, "衣之咲璃乃です！", 1, 2, 0, 1, 1.4, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1011);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("柏崎 初音", 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 2, 0, 1, 1.4, 0, "ち、超能力って…\n何のことかな～？", 1012);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("美波 鈴奈", 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, "ちょす！\n美波鈴奈だよ～♪", 1, 2, 0, 1, 1.4, 0, "一応カリスマ読モJKやってまっす！", 1016);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("喜屋武 香織", 0, 0, "でも、沖縄もとってもいいとこさー", 1, 0, "はいたーい。\n喜屋武香織さー。", 1, 2, 0, 1, 1.4, 0, "東京は遊園地みたいなところさー", 1017);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("支倉 伊緒", 0, 0, "イオちゃんって呼んでね。", 1, 0, "支倉伊緒です。", 1, 2, 0, 1, 1.4, 0, "先生って呼ばれるのは\nくすぐったいから", 1018);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("茜 ミミ", 0, 0, "ミミをおいてかないでぇ～", 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 2, 0, 1, 1.5, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1020);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("栗林 くるみ", 0, 0, "ふぇぇぇぇぇん……", 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 2, 0, 1, 1.5, 0, "あの……\nふぇ……", 1021);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("風宮 より", 0, 0, "なんてありがとうございます！", 1, 0, "風宮よりです。\nあああああ！", 1, 2, 0, 1, 1.4, 0, "こんな私に貴重な時間を\n割いていただき、", 1022);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("北条 綾音", 0, 0, "私こっち行きたいー\nね、早く早くー", 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 2, 0, 1, 1.5, 0, "おにいちゃんどこいくの？\nえ？", 1023);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("天野 すずめ", 0, 0, "これて何か違う…\nあああすみません！", 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 2, 0, 1, 1.4, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1025);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("倉石 恵理子", 0, 0, "離しませんわ………\n絶対に…!!", 1, 0, "……クスクス…私は\n…倉石恵理子……", 1, 2, 0, 1, 1.4, 0, "あなたは…運命の……\n伴侶……", 1027);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("佐々木 咲恋", 0, 0, "…そうでしょ？？", 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 2, 0, 1, 1.4, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("桜井 望", 0, 0, "あはは、\n私もまだまだだなぁ～", 1, 0, "桜井望だよ！\nよろしくねっ", 1, 2, 0, 1, 1.4, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1029);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("ニノン・ジュベール", 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, "デケデケデンっ！", 1, 2, 0, 1, 1.4, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1030);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("上喜 しのぶ", 0, 0, "おかしいですね……", 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 2, 0, 1, 1.4, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1031);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("野戸まひる", 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 2, 0, 1, 1.5, 0, "けんども\nそれには足りないモンが…", 1033);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("綾瀬 ゆかり", 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 2, 0, 1, 1.4, 0, "ちょっと緊張しちゃって…", 1034);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("氷川 鏡華", 0, 0, "これ以上お話しすることは…\nないです！", 1, 0, "氷川鏡華…です", 1, 2, 0, 1, 1.5, 0, "知らない人とは話しちゃいけないので", 1036);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("柏崎 栞", 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, "柏崎…栞です。", 1, 2, 0, 1, 1.4, 0, "……あ、アラーム。", 1038);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("双葉 碧", 0, 0, "野に咲く花が、\n唯一の話相手です。", 1, 0, "ふ、双葉碧です。", 1, 2, 0, 1, 1.4, 0, "私、一人も友達がいなくて……", 1040);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("三角 千歌", 0, 0, "そう思っています。", 1, 0, "三角千歌です。", 1, 2, 0, 1, 1.4, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("安芸 真琴", 0, 0, "う、疑ってすまなかったな…", 1, 0, "安芸真琴だ。", 1, 2, 0, 1, 1.4, 0, "あぁ？\nお前のそいつの仲間か？", 1043);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("イリヤ・オーンスタイン", 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, "わらわこそは夜を総べる者！", 1, 2, 0, 1, 1.4, 0, "生けとし生ける全ての者よ！", 1044);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("遠見 空花", 0, 0, "ｌク、クウカに何かご用ですか!?", 1, 0, "そこで騎士は妖精を乱暴に……", 1, 2, 0, 1, 1.4, 0, "ぐふふふふ……はっ！", 1045);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("宮坂たまき", 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 2, 0, 1, 1.4, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("大神 美冬", 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, "大神美冬よ！", 1, 2, 0, 1, 1.4, 0, "それでは早速クエストに…", 1048);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("星野静流", 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, "星野静流だよ！", 1, 2, 0, 1, 1.4, 0, "クエストもバトルも\n掃除も洗濯も", 1049);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("玉泉美咲", 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0, "アタシは玉泉美咲。", 1, 2, 0, 1, 1.5, 0, "見ての通りの\nセクシー美少女で", 1050);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("リマ", 0, 0, "？？？？", 1, 0, "？？？", 1, 2, 0, 1, 1.4, 0, "？？？？", 1052);
