INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("ペコリーヌ", 0, 0, "そ、そこまでいうなら\nもらってやる", 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1058);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("コッコロ", 0, 0, "そ、そこまでいうなら\nもらってやる", 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1059);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("キャル", 0, 0, "そ、そこまでいうなら\nもらってやる", 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1060);
